Archie, de man van staal is de Nederlandstalige titel van een Engels stripverhaal geschreven door de Brit E. George Cowan en getekend door Ted Kearon. Archie verscheen in Engeland in de &quot;Lion&quot;-strip (1952-1974). Eerst als The jungle Robot en later als Robot Archie. De reeks gaat over een robot die werd gebouwd door professor C.R. Ritchie en die bediend werd door zijn neefje Ted en diens beste vriend Ken Dale.
De albums verschenen vanaf 1963 in Nederland als &quot;Archie, de man van staal&quot;. De reeks werd vanaf 1971 voortgezet door de Nederlandse schrijver en tekenaar Bert Bus.

